import Menu from '../components/Menu';

import 'bootstrap/dist/css/bootstrap.min.css';

import {Jumbotron, Container} from 'reactstrap';

function QuemSomos() {
    return (
        <div>
            <Menu />
            <Jumbotron fluid className="sobre">
            <style>{`.sobre{
                        padding-top: 80px;
                        padding-bottom: 80px;
                        background-color: #DAA520;
                        color: #fff;
                        margin-bottom: 0rem !important;
                }`}</style>

                <Container>
                    <div className="text-center">
                        <h1 className='display-4'>Sobre a Robótica</h1>
                    </div>


                </Container>
            </Jumbotron>

            <Jumbotron fluid className="head-sobre">
            <style>{`.head-sobre{
                        padding-top: 80px;
                        padding-bottom: 80px;
                        background-color: #DAA520;
                        color: #fff;
                        margin-bottom: 0rem !important;
                    }
                    .featurette-divider {
                        margin: 5rem 0; 
                      }
                }`}</style>

                <Container>

                    <div class="row featurette">
                            <div class="col-md-7 order-md-2">
                                <h2 class="featurette-heading">Equipe de 2019. <span class="text-muted">Reunidos no laboratorio de fisica.</span></h2>
                                <p class="lead">Essa imagem ilustra muito bem o projeto da robotica, visto a grande diversidade alunos.</p>
                            </div>
                            <div class="col-md-5 order-md-1">
                                <img className="bd-placeholder-img bd-placeholder-img-lg featurette-image img-fluid mx-auto" src="equipeRobo.jpg" width="500" height="500" focusable="false"></img>

                            </div>
                        </div> 

                        <hr class="featurette-divider"/>
                      
                       
                        <div class="col-md-8">
                        <h3 class="pb-4 mb-4 fst-italic border-bottom">
                            O Começo de Tudo
                        </h3>

                        <article class="blog-post">
                            <h2 class="blog-post-title">Robotica Educacional</h2>
                            <p class="blog-post-meta">Setembro 17, 2018 <a href="#">Mark</a></p>

                            <p>Os alunos do Instituto Federal do Norte de Minas Gerais, Ângella e Wellison, munidos pela vontade de criar um projeto de extensão voltado para a robótica, buscaram um(a) coordenador(a) para o mesmo, encontrando a Docente Maria da Penha, juntos criaram o projeto.</p>
                            <hr/>
                            <p>Ângella era da Licenciatura em Física, Wellison era do Curso Tecnico em Informática e Maria da Penha, Docente da Area de Física</p>
                            <h2>Heading</h2>
                            <p>This is some additional paragraph placeholder content. It has been written to fill the available space and show how a longer snippet of text affects the surrounding content. We'll repeat it often to keep the demonstration flowing, so be on the lookout for this exact same string of text.</p>
                            <h3>Sub-heading</h3>
                            <p>This is some additional paragraph placeholder content. It has been written to fill the available space and show how a longer snippet of text affects the surrounding content. We'll repeat it often to keep the demonstration flowing, so be on the lookout for this exact same string of text.</p>
                            <pre><code>Example code block</code></pre>
                            <p>This is some additional paragraph placeholder content. It's a slightly shorter version of the other highly repetitive body text used throughout.</p>
                        </article>

                        </div>   

                </Container>
            </Jumbotron>
            
        </div>
    );
}

export default QuemSomos
